import React, { Fragment } from "react";
import "./App.css";

//components

import inputTodo from "./components/inputTodo";
import listTodos from "./components/listTodos";

function App() {
  return (
    <Fragment>
      <div className="container">
        <inputTodo />
        <listTodos />
      </div>
    </Fragment>
  );
}

export default App;
